import './App.css';
import { Router, Route} from 'react-router-dom';
import IniciarApp from './componentes/IniciarApp'


function App() {
  return (
    <div className="App">

    <Router>
      <Route path="/hola" component={<IniciarApp/>}></Route>
    </Router>
    </div>
  );
}

export default App;
